import * as React from 'react';
import { useWindowDimensions } from 'react-native'; 
import {View,
        StyleSheet,
        Image} from 'react-native';
import { createDrawerNavigator } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import { DrawerNavigator } from 'react-navigation';
import { MaterialIcons, AntDesign} from '@expo/vector-icons';
import  HomeScreen  from './src/screens/HomeScreen';
import  LoginScreen  from './src/screens/LoginScreen';
import  ViewBloodDonationCamps  from './src/screens/ViewBloodDonationCamps';
import  AboutBloodDonationScreen  from './src/screens/AboutBloodDonationScreen';
import  UserRegisterScreen  from './src/screens/UserRegisterScreen';
import  LogOutScreen from './src/screens/LogOutScreen';
import  SettingsScreen from './src/screens/SettingsScreen';  
import { createStackNavigator } from '@react-navigation/stack';
import Icon from 'react-native-vector-icons/FontAwesome';
import InitialScreen from './src/screens/InitialScreen';


const Drawer = createDrawerNavigator();
const Stack = createStackNavigator();

const Root = () => {//stack navigation between login screen and user register screen
  return(
    <Stack.Navigator>
      <Stack.Screen name="My Profile" component={LoginScreen} />
      <Stack.Screen name="Sign in" component={UserRegisterScreen} />
    </Stack.Navigator>
  );
}

const App = () => {//component for drawer navigator
  const dimensions = useWindowDimensions();
  return (    
    <NavigationContainer>
      <Drawer.Navigator> 
        <Drawer.Screen 
          name="Home" 
          component={HomeScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="home" 
                style={{fontSize: size, color: color}}/>
            ),
          }}
        />
        <Drawer.Screen 
          name="Initial Page" 
          component={InitialScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="home" 
                style={{fontSize: size, color: color}}/>
            ),
          }}
        />
        <Drawer.Screen 
          name="Sign in" 
          component={UserRegisterScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="home" 
                style={{fontSize: size, color: color}}/>
            ),
          }}
        />
        <Drawer.Screen 
          name="Blood Donation Camps" 
          component={ViewBloodDonationCamps}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="map-marker"  
                style={{fontSize: size, color: color}}/>
            ),
          }}
        />
        <Drawer.Screen 
          name="Login" 
          component={LoginScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="user"  
                style={{fontSize: size, color: color}}/>
            ),
          }}
        />
        <Drawer.Screen 
          name="About Blood Donation" 
          component={AboutBloodDonationScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="info"  
                style={{fontSize: size, color: color}}/>
            ),
          }} 
        />
        <Drawer.Screen 
          name="Log out" 
          component={LogOutScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="sign-out"  
                style={{fontSize: size, color: color}}/>
            ),
          }}      
        />
        <Drawer.Screen 
          name="Settings" 
          component={SettingsScreen}
          options={{ //add an icon to home
            drawerIcon: ({color,size}) => (
              <Icon 
                name="cogs"  
                style={{fontSize: size, color: color}}/>
            ),
          }} 
        />
      </Drawer.Navigator>
    </NavigationContainer>
  );
}


export default App;
